import React from "react";

function Quicklink() {
	return (
		<div className="w-1/3 h-24 overflow-hidden border rounded-xl">
			<img
				className="z-1 block h-1/9 w-1/8 bg-cover"
				src="https://images.pexels.com/photos/1302883/pexels-photo-1302883.jpeg?auto=compress&cs=tinysrgb&h=750&w=1260"
				alt="photobvfjg,"
			/>
		</div>
	);
}

export default Quicklink;
